import React, { Suspense } from 'react';
const FontAwesomeIcon  = React.lazy(() => import('@fortawesome/react-fontawesome').then(module => ({ default: module.FontAwesomeIcon })));
const fab  = React.lazy(() => import('@fortawesome/free-brands-svg-icons').then(module => ({ default: module.fab })));
const fas  = React.lazy(() => import('@fortawesome/free-solid-svg-icons').then(module => ({ default: module.fas })));
// .then(module => ({ default: module.OtherComponent }))

export const Facebook = props => {
    return (
        <Suspense fallback={<h1>Betöltés…</h1>}>
        <FontAwesomeIcon icon={fab.faFacebookSquare}/>  
        </Suspense>
    )
}

export const LeftArrow = props => {
    return (
        <Suspense fallback={<h1>Betöltés…</h1>}>
        <FontAwesomeIcon icon={fas.faArrowLeft}/>
        </Suspense>
    )
}
